import About from "../About/About";
import SearchBar from "../SearchBar/SearchBar";
import { Link } from "react-router-dom";


const Nav=({onSearch})=>{
    return(
        <nav>
       <Link to={'./home'}>
          <button>Home</button>
        </Link>
        <Link to={'./about'}>
          <button>About</button>
        </Link>
         <SearchBar onSearch={onSearch}/>
    
     </nav>
    )
}

export default Nav;
